    useEffect(()=>{
        fetch('https://hms-server1235.herokuapp.com/houses')
        .then((res)=>res.json())
        .then((data)=>setHouseItems(data))


    })
    const houseItemsList = houseItems.map((house)=>(
        <div className='houseItems'>
            <p> {house.name}</p>


        </div>


    ));
  return (
     <div> 
         {houseItemsList}



    </div>
  )
}

